        <img src={logo} className="App-logo" alt="logo" />
        <div className="str">Agenda de contacto</div>
      <div>
       
          <Enviar/>
          <Mostrar/> 
          <h2>Listado de Contactos</h2>
          <div id="prueba">
              
              
              
